import React from "react";
import { Link } from "react-router-dom";

const Subscription = () => {
  return (
    <div className="container mx-auto p-4">
      <h2 className="text-2xl font-bold">Choose Your Plan</h2>
      <p>Pay using Card, PayPal, or Rocket Credits.</p>
      <Link to="/payment" className="mt-4 inline-block bg-green-600 text-white px-4 py-2 rounded">Proceed to Payment</Link>
    </div>
  );
};

export default Subscription;
